import React from "react";

import SidebarItem from "./SidebarItem";

import Playlist from "../util/Playlist";

import "../stylesheets/Sidebar.css";

type SidebarProps = {
  currentScreen: string;
  playlists: { [id: string]: Playlist };
  displaying: boolean;
};

export default function Sidebar({
  currentScreen,
  playlists,
  displaying,
}: SidebarProps) {
  return (
    <div id="sidebar" className={displaying ? "sidebar-displaying" : ""}>
      <SidebarItem title="Home" currentScreen={currentScreen} type="Home" />
      <SidebarItem
        title="Recently Played"
        currentScreen={currentScreen}
        type="Recently Played"
      />
      {/* <div className="spotify-body-white text-center">Playlists</div> */}
      <SidebarItem title="ice" currentScreen={currentScreen} type="Playlist" />
      <SidebarItem
        title="yellow"
        currentScreen={currentScreen}
        type="Playlist"
      />
    </div>
  );
}
